> The improvement is good. But it is not clear to me why/how you had the issue. The "static" variable should be limited to the instance of the Queue class. Can you brief a little more about this? My concern here is, if there is an actual bug we have to use your new method for "pop" at various other places - but we do not really see the issue there currently.

I think it depends on the usage.

With our Rx optical power read tests, we saw that GPONs were much slower than XGS-PONs. So on GPONs there was a buildup (this is important) for Rx power measurements. The "static" keyword makes the timeout calculation valid for all the instances of the class, not only per current instance. Therefore unexpected timeouts were happening, even with a long enough timeout duration.
After these modifications this issue is not observed again.
If there is no buildup of instances, there may be no difference between this pop() and the regular pop().

I don't think that within locks there was ever a need for "static" usage. Unfortunately the original commit does not explain the reasoning behind the selection of "static" keyword, at least I didn't see one. If the original pop() was modified there would be a huge consequence, hence another pop().

The following code demonstrates that "duration", which is static, sticks around and maintains its value. Tested on Compiler Explorer:
https://godbolt.org/

    #include <iostream>

    class Q {
        public:
            void pop(int timeout, int wait_granularity=10) {
                static int duration = 0;
                std::cout << duration << '\n';
                duration += wait_granularity;
                std::cout << duration << "\n\n";
            }
    };

    int main() {
        for (int i = 0; i < 10; ++i) {
            Q q;
            q.pop(200);
        }
    }

